import { Text } from '@patternfly/react-core';
import { PageLayout } from '../PageLayout/PageLayout';

interface IKeycloakFailedPage {
  title?: string;
}

export const KeycloakFailedPage = ({ title }: IKeycloakFailedPage) => {
  return (
    <PageLayout title={title ? title : 'Error page'} description="Page unavailable">
      <Text>KEYCLOAK UNINITIALIZED</Text>
    </PageLayout>
  );
};
